import './App.css';

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/About" element={<Home />} />
        <Route path="/Users" element={<Home />} />
      </Routes>
    </>
  );
}

export default App;
